import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search input using placeholder selector (different from previous attempts)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // XSS payload
    const xssPayload = `<img src=x onerror=alert('XSS')>`;

    // Fill the search input with the XSS payload
    await page.fill('input[placeholder="Search Amazon"]', xssPayload);

    // Take screenshot after filling input
    const step2 = path.join(screenshotsDir, 'step_2_xss_input.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for the search button using a unique selector: button.search-btn (first occurrence)
    await page.waitForSelector('button.search-btn', { timeout: 5000 });

    // Click the first search button (using nth-of-type to avoid ambiguity)
    const searchBtn = await page.$$('button.search-btn');
    if (searchBtn.length > 0) {
      await searchBtn[0].click();
    } else {
      throw new Error('Search button not found');
    }

    // Wait for any possible DOM update (short delay, but not custom timeout)
    await page.waitForTimeout?.(500); // Playwright 1.32+ supports this, otherwise omit

    // Take screenshot after search attempt
    const step3 = path.join(screenshotsDir, 'step_3_after_search.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract the value from the search input to verify payload injection
    const inputValue = await page.$eval('input[placeholder="Search Amazon"]', el => el.value);

    // Try to find the payload rendered in the DOM (as text or HTML)
    let payloadInDOM = false;
    const bodyHTML = await page.content();
    if (bodyHTML.includes(xssPayload)) {
      payloadInDOM = true;
    }

    return {
      success: true,
      action: "Attempted XSS via search input and triggered search. Screenshots taken before, during, and after.",
      extractedData: {
        searchInputValue: inputValue,
        payloadInDOM
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
